iterations.yara_rule:
rule EvasionBypass {
    meta:
        description = "Detects bypass of critical exit calls"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { 6A 5A 8B 40 E0 C3 ?? ?? ?? ?? ?? 8B 45 ?? }
        $pattern1 = { FF 75 08 5A 8B C1 E8 A8 01 75 10 ?? ?? ?? ?? E8 C8 FF FF FF }
        $pattern2 = { FF 75 08 6A 5A 8B 40 E0 C3 ?? ?? ?? ?? ?? FF 15 AC B0 41 00 }

    condition:
        (any of the patterns matches)
}

